import React from "react";
import styled from "styled-components";

const BtnWrap = styled.div`
  width: 17rem;
`;
const EffectDiv = styled.div`
  border-width: 0px 3px 3px 0px;
  border-style: solid;
  border-color: #ff424d;
  filter: blur(2px);
  border-radius: 50px;
`;
const Btn = styled.div`
  line-height: 4rem;
  font-size: 1.5rem;
  margin: 1rem;
  background-color: #fff;
  border-radius: 50px;
  filter: brightness(2px)
`;
export const StartBtn = () => {
  return (
    <BtnWrap>
      <EffectDiv>
        <Btn>Start</Btn>
      </EffectDiv>
    </BtnWrap>
  );
};

export const AccountBtn = () => {
  return (
    <EffectDiv>
      <Btn>회원가입/로그인</Btn>
    </EffectDiv>
  );
};
